        var player = new SpritePlayer();
        var redrawInterval = null;
        var canvas = null;
        var ctx = null;
        var last_tick = -1;
        var bunnyIntro1 = null;
        var bunnyIntro2 = null;
        var bunnyIdle = null;

        function init()
        {
            canvas = document.getElementById('canvas');
            ctx = canvas.getContext('2d');
            player.setCacheVideo(true);
            //player.debug_mode=true;
            player.loadFromBase64(spriteData, onLoaded);
        }

        function onLoaded()
        {
            console.log(player.getAssetList());

            bunnyIntro1 = player.getSprite('bunnyIntro');
            bunnyIntro2 = player.getSprite('bunnyIntro');
            bunnyIdle = player.getSprite('bunnyIdle');

            draw();
        }

        function draw()
        {
            redrawInterval = requestAnimationFrame(draw);
            let dif = Date.now() - last_tick;
            let tick = 1000.0/player.getFramerate()
            if(dif < tick)
                return;

            last_tick += tick;
            if(dif>1000)
                last_tick = Date.now();



            ctx.clearRect(0,0,canvas.width, canvas.height);

            bunnyIntro1.draw(ctx,0,0);
            bunnyIdle.draw(ctx,0,100);
            bunnyIntro2.draw(ctx,0,300);

        }

    </script>

        </td>
    </tr>
</table>
</body>
